import React, { Component } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import IconButton from '@material-ui/core/IconButton';
import AccountCircle from '@material-ui/icons/AccountCircle';


class Header extends Component {

  render() {
    return (<header>
      <div className="header">
        <div className="header_logo">{this.props.title}</div>
        <div className="header_button" >
          <a className="header_button-select">応援する</a>
          <a href="/support" className="header_button-noselect">支援中</a>
          <a href="/Setting" className="header_button-noselect">支援してもらう</a>
        </div>
        <a href="/login" id="" title="ログイン" className="header_login">ログイン</a>
        <IconButton
                aria-label="account of current user"
                aria-controls="menu-appbar"
                aria-haspopup="true"
                color="inherit"
              >
                <AccountCircle />
              </IconButton>
      </div>
    </header>);
  }
}
export default Header;
